import './About.css';

const About = () => {
    return (
        <div className="about">
            <h2>Trading Network</h2>
            <p>This is an open-source project created by <i><a _blank href="https://www.linkedin.com/in/lyubomir-stamenov-1b97a61b4/">Lyubomir Stamenov</a></i></p>
        </div>
    );
}

export default About;
